import request from  'supertest'
import chai from 'chai'
import rewire from 'rewire'


const expect = chai.expect
const app = rewire( '../public/js/app' )

describe( 'SendITResources', ( ) => { 
    it( 'should show all parcels in the database', ( done ) => {
        request( app ).get('/parcels').expect( 200 ).end( done )
    } )
    it( 'should get the parcels with a specific parcelId', ( done ) => {
        request( app ).get('/parcels/:parcelId').expect( 200 ).end( done )
    } )
    it( 'should get the parcels with a specific userId', ( done ) => {
        request( app ).get('/users/:userId/parcels').expect( 200 ).end( done )
    } )
    it( 'should add a delivery order to all delvery orders', ( done ) => {
        request( app )
        .post('/users/:userId/parcels')
        .send( { name: 'something1', email: 'time1', cancelled: false, userId: 2, parcelId: 2 } )
        .expect( 200 )
        .end( done )
    } )
    it( 'should modify the status of a delivery order', ( done ) => {
        request( app )
        .put('/parcels/:userId/parcels/cancel')
        .send( { parcelId: 2, cancelled: true } )
        .expect( 200 )
        .end( done )
    } )

})

